import Mock from 'mockjs'

import FileManager from '../views/FileManagerModule/Mock/FileManager.js'
import ShellGlobal from '../views/ShellGlobalModule/Mock/ShellGlobal.js'
import New from "../views/NewModule/Mock/New.js"
Mock.setup({
    timeout: '500-600'
});
export default {
    ...FileManager,
    ...ShellGlobal,
    ...New
}
